import React from "react";
import { Card, Col, Container, Row } from "reactstrap";

const Attendence = () => {
  return (
    <>
      <div>
        <Row>
            <Col md='4'>
            </Col>
        </Row>
        <Card></Card>
      </div>
    </>
  );
};

export default Attendence;
